import react from "react";
import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import Categories from "./components/categories/Categories";

class App extends react.Component {
    constructor(props) {
        super(props);
    }
    render() {
        <div className="App">
            <Navbar></Navbar>
            <Categories className="Categories"></Categories>
        </div>;
    }
}

export default App;
